import React from 'react'
import {registerWithEmailAndPassword} from './config/firebase'
function App() {

  const register = async () => {
    let username = "taiduong.2641@gmail.com"
    let password = "Blackhat1"

   await registerWithEmailAndPassword(username, password)
  }

  return (
    <div>App
      <button onClick={register}>Register</button>
      <Link to="/authen"></Link>
    </div>
  )
}

export default App
